import { Component } from '@angular/core';
import { Router } from '@angular/router';

@Component({
  selector: 'app-forgot-password',
  templateUrl: './forgot-password.component.html',
  styleUrls: ['./forgot-password.component.css']
})
export class ForgotPasswordComponent {
  email: string = '';

  constructor(private router: Router) {}

  onSubmit() {
    // TODO: Implement forgot password logic
    console.log('Reset password requested for:', this.email);
    // After successful request, you might want to navigate to a confirmation page
    // this.router.navigate(['/reset-password-confirmation']);
  }
}
<div class="forgot-password-container">
  <div class="card">
    <div class="logo-container">
      <img src="assets/images/logo.png" alt="SkillMuni Logo" class="logo">
      <div class="logo-text">SKILLMUNI</div>
      <div class="logo-subtext">EMPOWERING FUTURES</div>
    </div>

    <h1>Forgot Password?</h1>
    <p class="description">We'll send a reset link to your registered email below — click it to set a new password and you're good to go.</p>

    <form (ngSubmit)="onSubmit()">
      <div class="form-group">
        <label for="email">Company Email:</label>
        <input 
          type="email" 
          id="email" 
          name="email" 
          placeholder="Companymail@gmail.com"
          [(ngModel)]="email"
          required>
      </div>

      <button type="submit" class="submit-btn">
        <span>Send</span>
        <span class="arrow-icon">→</span>
      </button>
    </form>
  </div>

  <div class="copyright">
    ©TGC Technologies Pvt Ltd
  </div>
</div>
